import atmSign from "../assets/atm_sign.png";
import ccSprite from "../assets/creditcard_sprite.png";

import { makeStyles } from 'tss-react/mui';


const useStyles = makeStyles()((theme) => ({
    atmSignShadow: {
        backgroundColor: "lightgray",
        height: "0.5em",
    },
    atmSignStyle: {
        width: "398px",
        height: "163px",
        backgroundColor: "#126cae"

    }
}));

function DisplayHeader() {
    const { classes } = useStyles();

    return (
        <div style={{ justifyItems: "center", backgroundColor: "white" }}>
            <div style={{justifyItems: "center"}}>
                <div className={classes.atmSignStyle}>
                    <img src={atmSign} alt="atmSign" />
                </div>
                <div className={classes.atmSignShadow} />
                <img src={ccSprite} alt="ccSprite" style={{ padding: "5px 0 0 0" }} />
            </div>
        </div>
    )
}

export default DisplayHeader;
